import React from "react";


const Counter = () => {
    const state = {
        count: 0,
        tags: ["tag1", "tag2", "tag3"]
    };

    const renderTags = () => {
        if (state.tags.length === 0)
            return <p>There are no tags!</p>
        return <ul>{state.tags.map(tag => <li key={tag}>{tag}</li>)}</ul>
    }



    return (
        <>
            {state.tags.length === 0 && " please create a new tag"}
            {renderTags()}
        </>
    )
}


export default Counter;
